import React from "react";

import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import AdminDashboard from "../UserAdmin/Dashboard"
import MainHome from "./MainHome";
// import fRegistration from "./Registration";
import MainNavbar from "./MainNavbar";
import ShowCompany from "./ShowUser";
import ShowStudent from "./ShowScholership";
import Sidebar from "../UserAdmin/NavbarA"

function App() {
  return (
    <Router>
      <div className="">

        <MainNavbar />
         <Switch>
          <Route path={"/main/dashboard"} component={AdminDashboard}/>
          <Route exact path={"/main/Home"} component={MainHome} />
          {/* <Route path={"/vendor/fsignup"} component={fRegistration} /> */}
          <Route path={"/main/ShowCompany"} component={ShowCompany} />
          <Route path={"/main/ShowStudent"} component={ShowStudent} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
